import React from "react";
import ReactPlayer from "react-player";
import "./Song.scss";

const Song = props => {
	console.log("got song");
	return (
		<div className="player" >
			<ReactPlayer url={props.url} controls={true} />
		</div>
	);
};

export default Song;
